  `payroll_project` int(11) DEFAULT NULL,
  `payroll_person_id` int(11) DEFAULT NULL,
  `payroll_month` int(5) DEFAULT NULL COMMENT 'tháng lương',
  `payroll_year` int(5) DEFAULT NULL COMMENT 'năm tính lương',
  `he_so_luong` varchar(190) DEFAULT NULL COMMENT '1',
  `phu_cap_chuc_vu` varchar(190) DEFAULT NULL COMMENT '2',
  `phu_cap_tham_nien_vuot` varchar(190) DEFAULT NULL COMMENT '3',
  `phu_cap_tham_nien_vuot_heso` varchar(190) DEFAULT NULL COMMENT '4=1*3',
  `phu_cap_trach_nhiem` varchar(190) DEFAULT NULL COMMENT '5',
  `phu_cap_tham_nien` varchar(190) DEFAULT NULL COMMENT '6',
  `phu_cap_tham_nien_heso` varchar(190) DEFAULT NULL COMMENT '7=(1+2+4)*6',
  `phu_cap_nghanh` varchar(190) DEFAULT NULL COMMENT '8',
  `phu_cap_nghanh_heso` varchar(190) DEFAULT NULL COMMENT '9=1*8',
  `tong_he_so` varchar(190) DEFAULT NULL COMMENT '10=1+2+4+5+7+9',
  `luong_co_so` varchar(190) DEFAULT NULL COMMENT '11',
  `tong_tien` varchar(190) DEFAULT NULL COMMENT '12=10*11',
  `tong_tien_luong` varchar(190) DEFAULT NULL COMMENT '13=12',
  `tong_tien_baohiem` varchar(190) DEFAULT NULL COMMENT '14= (1+2+4+5+7)*11*0.105 (10.5% BHXH + BHYT + BHTN)',
  `tong_luong_thuc_nhan` varchar(190) DEFAULT NULL COMMENT '15=13-14',
  PRIMARY KEY (`payroll_id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=latin1;

